INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (710, 10, 'Menyeterilkan alat medis', 'logbook/nugOr8wWLdPFZ0LucwBDn6AtLt1eLgQbKCCZPyLu.jpg', 'Untuk menghilangkan /memusnahkan semua bentuk mikroorganisme termasuk endospora pada peralatan medis/objek sehingga aman untuk digunakan', '2025-05-28', '2025-05-28 16:18:36', '2025-05-28 16:18:36');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (711, 10, 'Menyeterilkan alat medis', 'logbook/W6or7nujB3IBf4UvctKbDXRLcvNyIIpHXRvUgZA5.jpg', 'proses pembersihan dan penghilangan semua bentuk kehidupan mikroorganisme, termasuk spora, dari suatu benda atau bahan dengan menggunakan metode kimia atau fisika. Sterilisasi bertujuan untuk menciptakan kondisi steril, di mana tidak ada mikroorganisme yang dapat hidup dan berkembang biak. \nLebih rinci:\nTujuan:\nSterilisasi bertujuan untuk menghilangkan semua mikroorganisme, baik yang bersifat patogen (penyebab penyakit) maupun apatogen (tidak berbahaya),. \nMetode:\nSterilisasi dapat dilakukan dengan berbagai metode, antara lain:\nPemanasan: Pemanasan basah (autoklaf) dengan uap bertekanan atau pemanasan kering (misalnya dengan api). \nRadiasi: Radiasi UV atau radiasi gamma. \nFiltrasi: Filtrasi digunakan untuk bahan yang tidak tahan panas. \nBahan kimia: Bahan kimia bakteriostatik (menghambat pertumbuhan bakteri) atau bakterisida (membunuh bakteri). \nKapan digunakan:\nSterilisasi sangat penting dalam berbagai bidang, seperti:\nKesehatan: Sterilisasi peralatan medis untuk mencegah infeksi. \nLaboratorium: Sterilisasi peralatan dan media kultur untuk memastikan kualitas hasil penelitian. \nIndustri makanan: Sterilisasi produk makanan untuk mencegah kerusakan dan memastikan keamanannya. \nPerbedaan dengan disinfeksi:\nDisinfeksi hanya membunuh sebagian besar mikroorganisme, tetapi tidak menghilangkan semua bentuk kehidupan, termasuk spora. Sterilisasi menghilangkan semua mikroorganisme, termasuk spora. \n', '2025-05-23', '2025-05-28 16:20:39', '2025-05-28 16:20:39');
