INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (810, 10, 'Menyeterilkan alat medis', 'logbook/Y8igRTBsbk2wG4MvF8seOM7MUVBMtNik5XsrOeFq.jpg', 'Mencegah penyebaran infeksi antar pasien dan petugas kesehatan.\nMemastikan alat medis bebas dari kontaminasi yang dapat membahayakan pasien.\nMemastikan alat medis siap digunakan dengan aman dalam prosedur medis.', '2025-06-02', '2025-06-04 12:39:19', '2025-06-04 12:39:19');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (811, 10, 'Menyeterilkan alat medis', 'logbook/Na35BrkoURt2dCz0m2B4RoS1jrXg9fg7kPPHLI50.jpg', 'Sterilisasi alat rumah sakit adalah proses menghilangkan semua mikroorganisme hidup, termasuk spora bakteri, dari alat medis untuk mencegah infeksi pasien dan petugas kesehatan. Proses ini penting untuk memastikan alat medis yang digunakan dalam prosedur medis aman dan bebas dari kontaminasi.', '2025-06-03', '2025-06-04 12:40:44', '2025-06-04 12:40:44');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (812, 10, 'Menyeterilkan alat medis', 'logbook/XWGrP0KQCJ4TKgWN5rELELSLoyRtAxfS0x2kFOWy.jpg', 'Sterilisasi adalah proses untuk membebaskan suatu benda atau bahan dari semua bentuk kehidupan mikroorganisme, termasuk endospora, sehingga menjadi bebas dari kontaminasi. Proses ini bertujuan untuk mencegah pertumbuhan dan perkembangbiakan mikroorganisme, baik yang berbahaya maupun yang tidak berbahaya, sehingga memastikan keamanan dan kebersihan benda atau bahan tersebut.', '2025-06-04', '2025-06-04 12:42:41', '2025-06-04 12:42:41');
