INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (882, 24, 'Mendaftarkan Pasien Poliklinik Rawat Jalan dan IGD', 'logbook/pCVtNqc7hv5UVv9lSdSHW6gh3lJkNOx47xtvYMKr.jpg', 'Membantu pendaftaran mendaftarkan pasien umum dan BPJS ke poliklinik rawat jalan dan IGD di RSUD Malangbong', '2025-06-24', '2025-06-24 14:13:28', '2025-06-24 14:13:28');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (883, 10, 'Menyeterilkan alat medis', 'logbook/axl1avAl72Ck1HNfVCe8kWqxj2C1Pq9JRRN8xise.jpg', 'Sterilisasi adalah proses menghilangkan atau membunuh semua bentuk kehidupan mikroba, termasuk bakteri, virus, jamur, dan spora, dari suatu objek atau permukaan. Tujuannya adalah untuk menciptakan kondisi steril, yaitu kondisi yang benar-benar bebas dari mikroorganisme hidup. Sterilisasi dapat dicapai melalui berbagai metode, baik fisik maupun kimia.', '2025-06-24', '2025-06-24 14:23:02', '2025-06-24 14:23:02');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (884, 10, 'Menyeterilkan alat medis', 'logbook/6mZd5RP3DRd6AeEsTsf9C3em5Sx6AWJzBPPL8Oyq.jpg', 'Sterilisasi adalah proses membunuh semua mikroorganisme termasuk spora bakteri pada benda yang telah didekontaminasi dengan tepat.', '2025-06-20', '2025-06-24 14:24:55', '2025-06-24 14:24:55');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (885, 10, 'Menyeterilkan alat medis', 'logbook/8AEN8jS4Rixu3zyuDhLo5Q0LcSbxsoBO2Snz7ZNc.jpg', 'Mencegah Infeksi: Tujuan paling mendasar dari sterilisasi adalah untuk mencegah penyebaran infeksi. Dalam lingkungan medis, sterilisasi alat-alat bedah, jarum suntik, dan peralatan medis lainnya sangat penting untuk menghindari penularan penyakit dari satu pasien ke pasien lainnya. Sterilisasi memastikan bahwa tidak ada mikroorganisme berbahaya yang tertinggal pada peralatan yang digunakan', '2025-06-19', '2025-06-24 14:26:16', '2025-06-24 14:26:16');
