INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (897, 10, 'Menyeterilkan alat mesis', 'logbook/mVFlckexYimQH7ovFIIocdnmmraY8apzlm8dXE9W.jpg', 'Mencegah penyebaran infeksi antar pasien dan petugas kesehatan.\nMemastikan alat medis bebas dari kontaminasi yang dapat membahayakan pasien.\nMemastikan alat medis siap digunakan dengan aman dalam prosedur medis.', '2025-06-25', '2025-06-26 11:13:55', '2025-06-26 11:13:55');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (898, 10, 'Menyeterilkan alat medis', 'logbook/6Cg3zK3pom3bH2mMgebu286ZuKLW5oj50GLrxd4H.jpg', 'Sterilisasi alat rumah sakit adalah proses menghilangkan semua mikroorganisme hidup, termasuk spora bakteri, dari alat medis untuk mencegah infeksi pasien dan petugas kesehatan. Proses ini penting untuk memastikan alat medis yang digunakan dalam prosedur medis aman dan bebas dari kontaminasi.', '2025-06-26', '2025-06-26 11:16:01', '2025-06-26 11:16:01');
