INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1024, 10, 'Menyeterilkan alat medis', 'logbook/1Mo07OCW8s7MUcl5JxAXiVJZTpixXKGBVTyLgO8G.jpg', 'Sterilisasi adalah suatu cara untuk membebaskan sesuatu (alat, bahan, media, dll) dari mikroorganisme yang tidak diharapkan kehadirannya baik yang patogen maupun yang apatogen. Atau bisa juga dikatakan sebagai proses untuk membebaskan suatu benda dari semua mikroorganisme baik bentuk vegetatif maupun bentuk spora.', '2025-07-01', '2025-07-04 09:28:29', '2025-07-04 09:28:29');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1025, 10, 'Menyeterilkan alat medis', 'logbook/qQCB8qm5mKLSXtf6gK3GVW7ACjANxSwkbKzj4Zip.jpg', 'Sterilisasi memastikan alat-alat medis siap digunakan dalam prosedur medis tanpa membahayakan pasien.', '2025-07-02', '2025-07-04 09:29:40', '2025-07-04 09:29:40');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1026, 10, 'Menyeterilkan alat medis', 'logbook/rhcUoDcmlZvbiIDoep47QctT7ikoFnfHkww9x5pB.jpg', 'Sterilisasi alat medis merujuk pada proses menghilangkan semua bentuk mikroorganisme yang ada pada alat medis. Tujuan utama sterilisasi adalah untuk mencegah penyebaran infeksi dan memastikan alat-alat tersebut bebas dari kontaminan yang dapat membahayakan pasien. Sterilisasi juga memastikan bahwa alat-alat medis siap digunakan dengan aman dalam prosedur medis.', '2025-07-03', '2025-07-04 09:30:49', '2025-07-04 09:30:49');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1027, 10, 'Menyeterilkan alat medis', 'logbook/AYm66kgmqUaCCYjRFiDs0kHU9EYJec14CgopE6AZ.jpg', 'Sterilisasi alat medis juga penting untuk mencegah kontaminasi silang antara pasien. Setiap pasien memiliki kondisi kesehatan yang unik, dan penggunaan alat yang tidak steril dapat mengakibatkan penyebaran mikroorganisme antara pasien yang berbeda. Sterilisasi yang tepat memastikan bahwa setiap pasien menerima perawatan yang aman dan bebas dari risiko infeksi.', '2025-07-04', '2025-07-04 09:32:28', '2025-07-04 09:32:28');
