INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1057, 10, 'Menyeterilkan alat medis', 'logbook/AWFcmpyoIKQw6vtk5TcsivSosDmK2G7OFaqRBFws.jpg', 'Sterilisasi adalah proses untuk membebaskan suatu benda atau bahan dari semua bentuk kehidupan mikroorganisme, termasuk endospora, sehingga menjadi bebas dari kontaminasi. Proses ini bertujuan untuk mencegah pertumbuhan dan perkembangbiakan mikroorganisme, baik yang berbahaya maupun yang tidak berbahaya, sehingga memastikan keamanan dan kebersihan benda atau bahan tersebut.', '2025-07-08', '2025-07-09 11:13:34', '2025-07-09 11:13:34');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1058, 10, 'Menyeterilkan alat medis', 'logbook/Eg8u2xOgiZBX8Cid03EnOwq8eQ7nYErlj8uJaQx1.jpg', 'Sterilisasi adalah suatu cara untuk membebaskan sesuatu (alat, bahan, media, dll) dari mikroorganisme yang tidak diharapkan kehadirannya baik yang patogen maupun yang apatogen. Atau bisa juga dikatakan sebagai proses untuk membebaskan suatu benda dari semua mikroorganisme baik bentuk vegetatif maupun bentuk spora.', '2025-07-09', '2025-07-09 11:14:54', '2025-07-09 11:14:54');
