INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1072, 10, 'Menyeterilkan alat medis', 'logbook/Ehu8DYIS6ywEUpusPelRjpuyaZBxDjVvRSEHHtq1.jpg', 'sterilisasi adalah proses penting untuk menghilangkan bakteri, virus, dan mikroorganisme lainnya dari peralatan medis dan bahan kesehatan', '2025-07-15', '2025-07-16 14:44:28', '2025-07-16 14:44:28');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1073, 10, 'Menyeterilkan alat medis', 'logbook/iStZlYnnhuKutZVzb0tgQOPDaC6RzKEbEM96EgYs.jpg', 'Sterilisasi adalah proses menghilangkan atau membunuh semua bentuk kehidupan mikroba, termasuk bakteri, virus, jamur, dan spora, dari suatu objek atau permukaan. Tujuannya adalah untuk menciptakan kondisi steril, yaitu kondisi yang benar-benar bebas dari mikroorganisme hidup. Sterilisasi dapat dicapai melalui berbagai metode, baik fisik maupun kimia.', '2025-07-16', '2025-07-16 14:49:40', '2025-07-16 14:49:40');
