INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1076, 5, 'Pendaftaran & Billing', 'logbook/aXNje0hUuiaGd0LfXIVko7hrwhuzF7lsD88aP2IS.jpg', 'Mendaftarkan dan melakukan registrasi pada pasien Rawat Jalan Poliklinik, IGD dan Rawat Inap.\nMelakukan billing pasien Rawat jalan Poliklinik, IGD dan Rawat Inap.', '2025-07-16', '2025-07-17 07:36:59', '2025-07-17 07:36:59');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1077, 10, 'Menyeterilkan alat medis', 'logbook/8SvyLUGAoaVLrmZhGRF2mzwvulr8N3nemkHnTqAb.jpg', 'Sterilisasi adalah proses untuk membebaskan suatu benda atau bahan dari semua bentuk kehidupan mikroorganisme, termasuk endospora, sehingga menjadi bebas dari kontaminasi. Proses ini bertujuan untuk mencegah pertumbuhan dan perkembangbiakan mikroorganisme, baik yang berbahaya maupun yang tidak berbahaya, sehingga memastikan keamanan dan kebersihan benda atau bahan tersebut.', '2025-07-17', '2025-07-17 12:36:38', '2025-07-17 12:36:38');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1078, 10, 'Menyeterilkan alat medis', 'logbook/Y7mNy0uiPGj0P2U2SEkauvM8q3cA1LFaAkqDOM9C.jpg', 'sterilisasi alat medis adalah praktik penting yang bertujuan untuk memastikan kebersihan dan keamanan pasien. Sterilisasi yang efektif dapat mencegah infeksi, penyebaran penyakit, dan risiko kontaminasi yang dapat merugikan pasien', '2025-07-18', '2025-07-18 11:10:22', '2025-07-18 11:10:22');
