INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1092, 10, 'Menyeterilkan alat medis', 'logbook/rnN46NDVShJX8Y76E08LNCYP55uKvUUtnzkTVc7z.jpg', 'Sterilisasi alat medis merujuk pada proses menghilangkan semua bentuk mikroorganisme yang ada pada alat medis. Tujuan utama sterilisasi adalah untuk mencegah penyebaran infeksi dan memastikan alat-alat tersebut bebas dari kontaminan yang dapat membahayakan pasien. Sterilisasi juga memastikan bahwa alat-alat medis siap digunakan dengan aman dalam prosedur medis.', '2025-07-23', '2025-07-23 15:24:37', '2025-07-23 15:24:37');
