INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1113, 10, 'Menyeterilkan alat medis', 'logbook/cjJ26MCaE93v9ZV2AIy5bThbOCPuif0MJw1U5Pwk.jpg', 'sterilisasi adalah proses penting untuk menghilangkan bakteri, virus, dan mikroorganisme lainnya dari peralatan medis dan bahan kesehatan', '2025-07-24', '2025-07-28 11:35:45', '2025-07-28 11:35:45');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1114, 10, 'Menyeterilkan alat medis', 'logbook/WFUvXn05W3oxJnPFR6IHdK3dqmDFaKJMKhUQI3I8.jpg', 'sterilisasi alat medis adalah praktik penting yang bertujuan untuk memastikan kebersihan dan keamanan pasien. Sterilisasi yang efektif dapat mencegah infeksi, penyebaran penyakit, dan risiko kontaminasi yang dapat merugikan pasien', '2025-07-25', '2025-07-28 11:37:23', '2025-07-28 11:37:23');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1115, 10, 'Menyeterilkan alat medis', 'logbook/bwgrOWDHqBnNUCRSlcAz79E1KlFB9Zw9LplE2ERa.jpg', 'Sterilisasi alat medis juga penting untuk mencegah kontaminasi silang antara pasien. Setiap pasien memiliki kondisi kesehatan yang unik, dan penggunaan alat yang tidak steril dapat mengakibatkan penyebaran mikroorganisme antara pasien yang berbeda. Sterilisasi yang tepat memastikan bahwa setiap pasien menerima perawatan yang aman dan bebas dari risiko infeksi.', '2025-07-28', '2025-07-28 11:38:33', '2025-07-28 11:38:33');
