INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1354, 10, 'Menyeterilkan alat medis', 'logbook/JVARXbQD2pdU6yWw1BZcxU6pStRVO26h3rFrMug8.jpg', 'sterilisasi adalah suatu proses untuk menghilangkan semua bentuk kehidupan meliputi patogen, non patogen, vegetatif, dan non vegetatif dari suatu objek atau material. Sterilisasi sendiri berasal dari kata steril yang artinya bersih dari kuman atau mikroorganisme lain.', '2025-08-12', '2025-08-12 16:02:08', '2025-08-12 16:02:08');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1355, 5, 'Pendaftaran & Billing', 'logbook/myXNhVT8WNAgpj714igIa9DmOIaDfyy2paglKJ2t.jpg', 'Mendaftarkan dan melakukan registrasi pada pasien Rawat Jalan Poliklinik, IGD dan Rawat Inap.\nMembuat KIB Pasien (Bagi pasien baru).\nMelakukan billing pasien Rawat jalan Poliklinik, IGD dan Rawat Inap.', '2025-08-13', '2025-08-13 07:20:45', '2025-08-13 07:20:45');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1356, 5, 'Pendaftaran & Billing', 'logbook/A5FJoxJSl6UvXcsB4PXF8Nlr7gk1DlCgZLsgL58k.jpg', 'Mendaftarkan dan melakukan registrasi pada pasien Rawat Jalan Poliklinik, IGD dan Rawat Inap.\nMelakukan billing pasien Rawat jalan Poliklinik, IGD dan Rawat Inap.', '2025-08-12', '2025-08-13 07:22:45', '2025-08-13 07:22:45');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1357, 10, 'Menyeterilkan alat medis', 'logbook/8UNdXrahir3AQSzKBjNgceHktieSVgYETjnJnHfs.jpg', 'Sterilisasi adalah suatu proses yang dilakukan untuk membunuh atau menghilangkan organisme hidup yang terdapat suatu sampel, benda atau bahan. Sterilisasi dilakukan untuk menjamin kualitas bahan produk atau alat yang digunakan pada laboratorium atau dalam bidang kesehatan.', '2025-08-15', '2025-08-15 16:16:12', '2025-08-15 16:16:12');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1358, 10, 'Menyeterilkan alat medis', 'logbook/tchk9s6IGVZW4MXrFEePwp994SSXEiEatq21TrEt.jpg', 'Sebuah alat kesehatan dapat dikatakan steril apabila alat tersebut bebas dari mikroorganisme. Karena itu, sterilisasi merupakan proses menghilangkan semua mikroorganisme tersebut seperti bakteria, virus, fungi dan parasit, termasuk endospora pada alat-alat medis yang sering digunakan berulang kali seperti alat bedah yang berbahan logam, alat laboratorium yang berbahan kaca, dan lain-lain.', '2025-08-14', '2025-08-15 16:17:12', '2025-08-15 16:17:12');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1359, 10, 'Menyeterilkan alat medis', 'logbook/NsvwTE9YZSWlIfOFv0p2H7oLJ0dQrrueBFySUOfg.jpg', 'Sterilisasi alat medis adalah proses penting dalam menjaga kebersihan, keamanan, dan efektivitas pengobatan. Keberhasilan sterilisasi tergantung pada pemilihan metode yang tepat, penerapan prosedur yang benar, dan pengawasan yang ketat. Tenaga medis, baik di rumah sakit, praktik dokter umum, klinik kecantikan, atau laboratorium, memiliki peran penting dalam menjaga keberhasilan sterilisasi. Dengan menerapkan standar sterilisasi yang tepat dan mengikuti perkembangan teknologi sterilisasi, kita dapat meningkatkan keamanan pasien dan meningkatkan kualitas perawatan medis', '2025-08-13', '2025-08-15 16:21:14', '2025-08-15 16:21:14');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1360, 5, 'Pendaftaran & Billing', 'logbook/2PlOnSKHIuhuJ90JKQfkFWWuOMykjDtoo6xXvbQh.jpg', 'Mendaftarkan dan melakukan registrasi pada pasien Rawat Jalan Poliklinik, IGD dan Rawat Inap.\nMelakukan billing pasien Rawat jalan Poliklinik, IGD dan Rawat Inap.', '2025-08-14', '2025-08-16 12:14:26', '2025-08-16 12:14:26');
