INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1381, 10, 'Menyeterilkan alat medis', 'logbook/biiWpMCoexQxSjIrEEX5bjsoCfwoEEHsVPNl2B4U.jpg', 'Tujuan utama sterilisasi adalah untuk mencegah penyebaran infeksi dan memastikan alat-alat tersebut bebas dari kontaminan yang dapat membahayakan pasien. Sterilisasi juga memastikan bahwa alat-alat medis siap digunakan dengan aman dalam prosedur medis.', '2025-08-19', '2025-08-21 07:18:17', '2025-08-21 07:18:17');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1382, 10, 'Menyeterilkan alat medis', 'logbook/GMYVGqoRK1v5mDLgvSvVj5VKudLYCWjZcXhvIrcM.jpg', 'Dalam dunia medis, sterilisasi alat medis adalah praktik penting yang bertujuan untuk memastikan kebersihan dan keamanan pasien. Sterilisasi yang efektif dapat mencegah infeksi, penyebaran penyakit, dan risiko kontaminasi yang dapat merugikan pasien.', '2025-08-20', '2025-08-21 07:19:23', '2025-08-21 07:19:23');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1383, 10, 'Menyeterilkan alat medis', 'logbook/XoGyNWh8I59RD6UgigP5qoxeOorMs7dbgcs9GFkI.jpg', 'Sterilisasi alat medis juga penting untuk mencegah kontaminasi silang antara pasien. Setiap pasien memiliki kondisi kesehatan yang unik, dan penggunaan alat yang tidak steril dapat mengakibatkan penyebaran mikroorganisme antara pasien yang berbeda. Sterilisasi yang tepat memastikan bahwa setiap pasien menerima perawatan yang aman dan bebas dari risiko infeksi.', '2025-08-21', '2025-08-21 07:20:37', '2025-08-21 07:20:37');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1384, 9, 'Menyetrika', 'logbook/e7w1PtsN2kFEgvi8LWNtLpLljqRJtIxQYmsteM7d.jpg', 'Menyetrika dan merapihkan linen,selimut dan baju perawat IBS yang sudah melakukan tindakan oprasi', '2025-08-21', '2025-08-21 16:49:48', '2025-08-21 16:49:48');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1385, 9, 'Menyetrika', 'logbook/KkVebeBIYJpiwnFlbYFvcjq2AxqVRf8i2vM63pr1.jpg', 'Menyetrika baju perawat IBS yang sudah melakukan tindakan oprasi sc ', '2025-08-14', '2025-08-21 16:50:44', '2025-08-21 16:50:44');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1386, 9, 'Menyetrika dan melipat', 'logbook/LMBKeOfjGoNIoA8pkiKgfFowvKha2fUu226RJxlP.jpg', 'Menyetrika dan melipat linen dan selimut yang sudah d cuci \nBekas pemakaian pasien ', '2025-08-22', '2025-08-22 09:25:47', '2025-08-22 09:25:47');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1387, 5, 'Pendaftaran & Billing', 'logbook/T8XEBUKWjTy8ZwZBPhGokp4szYbONN6CzfmDWbSF.jpg', 'Mendaftarkan dan melakukan registrasi pada pasien Rawat Jalan Poliklinik, IGD dan Rawat Inap.\nMelakukan billing pasien Rawat jalan Poliklinik, IGD dan Rawat Inap.', '2025-08-22', '2025-08-23 08:59:58', '2025-08-23 08:59:58');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1388, 5, 'Pendaftaran & Billing', 'logbook/t7VGZj4GQhrgSOjnUG1YRj5UV2XjVusXTvS5ObwU.jpg', 'Mendaftarkan dan melakukan registrasi pada pasien Rawat Jalan Poliklinik, IGD dan Rawat Inap.\nMelakukan billing pasien Rawat jalan Poliklinik, IGD dan Rawat Inap.', '2025-08-23', '2025-08-23 09:01:16', '2025-08-23 09:01:16');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1389, 8, 'Kefarmasian', 'logbook/9SOqq96Qr1PNMDrYa68gMjfAOYXycvGsvAPlt8gA.jpg', 'Menyiapkan dan menyimpan resep kedalam kartu stok sesuai dengan obatnya', '2025-08-01', '2025-08-24 13:45:59', '2025-08-24 13:45:59');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1390, 10, 'Menyeterilkan alat medis', 'logbook/LrrM6dUXXXIOakEFGL2WXaf8M48dc2966oHQoyz0.jpg', 'Sterilisasi alat medis adalah proses penting dalam menjaga kebersihan, keamanan, dan efektivitas pengobatan. Keberhasilan sterilisasi tergantung pada pemilihan metode yang tepat, penerapan prosedur yang benar, dan pengawasan yang ketat. Tenaga medis, baik di rumah sakit, praktik dokter umum, klinik kecantikan, atau laboratorium, memiliki peran penting dalam menjaga keberhasilan sterilisasi. Dengan menerapkan standar sterilisasi yang tepat dan mengikuti perkembangan teknologi sterilisasi, kita dapat meningkatkan keamanan pasien dan meningkatkan kualitas perawatan medis', '2025-08-22', '2025-08-25 10:14:51', '2025-08-25 10:14:51');
INSERT INTO `logbooks` (`id`, `user_id`, `name`, `foto`, `keterangan`, `tanggal`, `created_at`, `updated_at`) VALUES (1391, 10, 'Menyeterilkan alat medis', 'logbook/awC8uTmWo63x1JYPSP52BWnoOAXsUXOwDpywpaba.jpg', 'Sebuah alat kesehatan dapat dikatakan steril apabila alat tersebut bebas dari mikroorganisme. Karena itu, sterilisasi merupakan proses menghilangkan semua mikroorganisme tersebut seperti bakteria, virus, fungi dan parasit, termasuk endospora pada alat-alat medis yang sering digunakan berulang kali seperti alat bedah yang berbahan logam, alat laboratorium yang berbahan kaca, dan lain-lain.', '2025-08-25', '2025-08-25 10:16:01', '2025-08-25 10:17:46');
